def generate_primes(n, p=3, primes=None):
    if primes is None:
        primes = [True for _ in range(n)]
    if p * p > n:
        return [i for i in range(2, n) if primes[i]]
    if primes[p]:
        for i in range(p * p, n, p):
            primes[i] = False
    return generate_primes(n, p + 1, primes)

